import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { getProfile } from '../services/api';

export default function Home() {
  const [user, setUser] = useState(null);
  const [loading, setLoading] = useState(true);
  const [unreadChat, setUnreadChat] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    async function load() {
      try {
        const res = await getProfile();
        setUser(res.user);
      } catch (err) {
        // no profile -> go to login
        localStorage.removeItem('token');
        navigate('/login');
      } finally {
        setLoading(false);
      }
    }
    load();
  }, [navigate]);

  // listen for new chat message events
  useEffect(() => {
    const handler = (e) => {
      const added = e?.detail?.added || 1;
      setUnreadChat(c => c + added);
    };
    window.addEventListener('chat:new-message', handler);
    // clear when navigating to chat
    const clearOnFocus = () => setUnreadChat(0);
    window.addEventListener('focus', clearOnFocus);
    return () => { window.removeEventListener('chat:new-message', handler); window.removeEventListener('focus', clearOnFocus); };
  }, []);

  if (loading) return <div className="container"><p>Loading...</p></div>;

  return (
    <div className="page">
      <div className="page-header">
        <div>
          <div className="brand">
            <h2 className="brand-heading">Near-me Adventures</h2>
          </div>
          <div>Welcome, {user?.name}! Your gateway to unforgettable local experiences!</div>
        </div>
        <div style={{ textAlign: 'right' }}>
          <div className="muted">{user?.email}</div>
        </div>
      </div>

      <div className="home-actions">
        <div className="action-card">
          <Link to="/browse"><button>Browse Experiences</button></Link>
        </div>
        <div className="action-card">
          <Link to="/trending"><button>Trending Experiences</button></Link>
        </div>
        <div className="action-card">
          <Link to="/dashboard"><button>User's Dashboard</button></Link>
        </div>
        <div className="action-card">
          <Link to="/reviews"><button>Reviews</button></Link>
        </div>
        <div className="action-card">
          <button style={{ marginRight: 8, position: 'relative' }} onClick={() => { setUnreadChat(0); navigate('/chat'); }}>
            Chat Box
            {unreadChat > 0 && (
              <span className="chat-unread-badge" title={`${unreadChat} new message(s)`}>{unreadChat}</span>
            )}
          </button>
        </div>
        <div className="action-card">
          <button onClick={() => navigate('/recommendation')}>Recommendations</button>
        </div>
        <div className="action-card">
          <button className="btn-logout" onClick={() => { localStorage.removeItem('token'); navigate('/login'); }}>Logout</button>
        </div>
      </div>
    </div>
  );
}
